import { Injectable } from '@angular/core';
import * as jsPDF from 'jspdf';

@Injectable({
    providedIn: 'root',
})
export class PropertyDetailService {

    constructor() { }

    buildPdf(data) {
        var doc = new jsPDF('l', 'mm', [216, 279]);
        doc.setProperties({
            title: 'Detalle de Propiedad',
            subject: 'Documento generado por Plataforma Inmobiliaria powered by Piensa Software',
            author: 'www.piensasoftware.com',
            keywords: 'pdf, www.piensasoftware.com',
            creator: 'Ingeniero Edgar Torres, Piensa Software'
        });

        var background = 'data:image/jpeg;base64,';
        doc.addImage(background, 'JPG', 0, 0, 279, 0);

        doc.setFont('helvetica');

        doc.setTextColor(242, 130, 28);
        doc.setFontSize(26);
        doc.setFontStyle('bold');
        doc.text('Detalle de Propiedad', 139.5, 26, 'center');

        doc.setDrawColor(187, 187, 187);
        doc.setLineWidth(0.1);
        doc.line(139.5, 36, 139, 195)

        doc.setFontStyle('normal');
        doc.setTextColor(68, 68, 68);
        doc.setFontSize(18);
        var linesSail = doc.splitTextToSize(data.title, 119);

        if (linesSail.length > 4)
            linesSail.splice(4, linesSail.length - 4);

        doc.text(151, 47, linesSail);

        doc.setTextColor(242, 130, 28);
        doc.text(151, 47 + (linesSail.length * 8), 'MXN $' + Number(data.price).toLocaleString('en-GB'));

        doc.addImage(data.propertyImage[0].url, 'JPG', 12.5, 41, 119, 0);

        doc.addImage(data.propertyImage[1].url, 'JPG', 12.5, 119, 57.5, 0);

        if (data.propertyImage[2])
            doc.addImage(data.propertyImage[2].url, 'JPG', 74, 119, 57.5, 0);

        if (data.propertyImage[3])
            doc.addImage(data.propertyImage[3].url, 'JPG', 12.5, 159, 57.5, 0);

        if (data.propertyImage[4])
            doc.addImage(data.propertyImage[4].url, 'JPG', 74, 159, 57.5, 0);

        doc.setTextColor(68, 68, 68);
        doc.setFontSize(12);
        doc.setFontStyle('bold');

        doc.text(151, 88, 'Descripci\u00F3n:');

        doc.setFontStyle('normal');
        doc.setFontSize(9);
        linesSail = doc.splitTextToSize(data.description, 119);

        if (linesSail.length > 13)
            linesSail.splice(13, linesSail.length - 13);

        doc.text(151, 94, linesSail);

        doc.setFontSize(12);
        doc.setFontStyle('bold');
        doc.text(151, 147, 'Direci\u00F3n:');

        var address = 'Calle ' + data.street + ' ' + data.number + ', Colonia ' + data.settlement + ', ' + data.municipality + '. ' + data.state;

        doc.setFontStyle('normal');
        doc.setFontSize(10);
        linesSail = doc.splitTextToSize(address, 119);
        doc.text(151, 152, linesSail);

        doc.setFontSize(12);
        doc.setFontStyle('bold');
        doc.text(151, 165, 'Detalles:');

        var detail = data.metersLand != null ? 'Metros: ' + data.metersLand + ', ' : '';

        detail += data.metersBuilt != null ? 'Construcci\u00F3n:' + data.metersBuilt + ', ' : '';

        detail += data.level != null && data.level > 0 ? 'Niveles: ' + data.level + ', ' : '';

        detail += data.bedrooms != null && data.bedrooms > 0 ? 'Habitaciones: ' + data.bedrooms + ', ' : '';

        detail += data.bathrooms != null && data.bathrooms > 0 ? 'Ba\u00F1os: ' + data.bathrooms + ', ' : '';

        detail += data.garage != null && data.garage > 0 ? 'Estacionamientos: ' + data.garage + ', ' : '';

        doc.setFontStyle('normal');
        doc.setFontSize(10);
        linesSail = doc.splitTextToSize(detail, 119);
        doc.text(151, 170, linesSail);

        doc.setFontSize(12);
        doc.setFontStyle('bold');
        doc.text(151, 183, 'Contacto:');

        doc.setFontStyle('normal');
        doc.setFontSize(10);
        doc.text(151, 188, 'Correo: ' + data.email + ', Tel\u00E9fono: ' + data.phoneOne);

        doc.setTextColor(43, 45, 154);
        doc.setFontSize(12);
        doc.setFontStyle('normal');
        doc.text('https://onlinepropiedades.com/#/propertyDetail?propertyId=' + data.id, 139.5, 209, 'center');

        return doc;
    }
}